import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

// import components
import Test from './test';

function App() {
return (
    <Router>
        <div className="App">
            <Switch>
                <Route path="/test" component={Test} />
            </Switch>
        </div>
    </Router>
);}

export default App;
